import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from "./components/Header";
import Technoligies from "./Technologies";
import Footer from "./Footer";
import anonymous from "./media/create_account_2_anonymous.png"
import back_img from "./media/back_img.jpg"
import raccoon from "./media/raccoon.jpg"

function App() {
  return (
    <div className="app-wrapper">
        <Header/>

        <div className="content">
            <div>
                <img src={back_img}/>
            </div>
            <div>
                <img src={raccoon}/>
            </div>
            <div>
                My posts
                <div>New post</div>
                <div>
                    <div>
                        post 1
                    </div>
                    <div>
                        post 2
                    </div>
                </div>
            </div>
        </div>
    </div>
  );
}





export default App;
